css:
.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: system-ui;
  font-size: 12px;
  color: #474747;
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.no-repository {
  padding: 30px;
  text-align: center;
}
.github-Git.is-loading {
  color: #949494;
}
.github-Git.no-repository {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
}
.github-Git.no-repository > * {
  margin: 10px 0;
}
.github-Git.no-repository .git-logo-path {
  fill: #c1c1c1;
}
.github-Git.no-repository .btn.btn-primary {
  overflow: hidden;
  text-overflow: ellipsis;
}
